import React, { Component } from 'react';
import './PlanBuilder.css'

class PlanBuilder extends Component {
    render() {
        return(
            <div>
                <img src="/images/progress_bar.png" alt="Progress bar"></img>
                <section>
                    <detail className='plan-tool'>
                        <summary>Hey</summary>
                    </detail>

                </section>
            </div>
        )
    }
}

export default PlanBuilder;
